  "translationLines": [
    {
      "lineNumber": 123331,
      "originalJapaneseLine": "「あなたに言われるのは非常に遺憾ですが、",
      "translatedEnglishLine": "\"It's very unfortunate to hear that from you, but,"
    },
    {
      "lineNumber": 123332,
      "originalJapaneseLine": "　ええ……その通りですね……」",
      "translatedEnglishLine": "yes... that's exactly right...\""
    },
    {
      "lineNumber": 123333,
      "originalJapaneseLine": "「しかし、アレは大丈夫なのか？」",
      "translatedEnglishLine": "\"But, is that thing really okay?\""
    },
    {
      "lineNumber": 123334,
      "originalJapaneseLine": "「本当に全くただの一つも家事が出来ない、",
      "translatedEnglishLine": "\"It's not that she really can't do a single household chore at all,"
    },
    {
      "lineNumber": 123335,
      "originalJapaneseLine": "　ってわけではないので……」",
      "translatedEnglishLine": "it's not like that...\""
    },
    {
      "lineNumber": 123336,
      "originalJapaneseLine": "「まあ、多分、大丈夫かと……」",
      "translatedEnglishLine": "\"Well, I think she'll probably be fine...\""
    },
    {
      "lineNumber": 123337,
      "originalJapaneseLine": "「不安そうな言い方だな」",
      "translatedEnglishLine": "\"That sounds rather doubtful.\""
    },
    {
      "lineNumber": 123338,
      "originalJapaneseLine": "「正直、私のことを思うなら、",
      "translatedEnglishLine": "\"Honestly, if you care about me,"
    },
    {
      "lineNumber": 123339,
      "originalJapaneseLine": "　何もせず大人しくしていて欲しいです。",
      "translatedEnglishLine": "I'd rather you do nothing and just stay quiet."
    },
    {
      "lineNumber": 123340,
      "originalJapaneseLine": "　気になって休むどころじゃなくなるので」",
      "translatedEnglishLine": "Because I'd be too worried to actually rest.\""
    },
    {
      "lineNumber": 123341,
      "originalJapaneseLine": "「辛辣だな……」",
      "translatedEnglishLine": "\"That's harsh...\""
    },
    {
      "lineNumber": 123342,
      "originalJapaneseLine": "「もちろん感謝はしてますよ」",
      "translatedEnglishLine": "\"Of course, I am grateful.\""
    },
    {
      "lineNumber": 123343,
      "originalJapaneseLine": "「勝子、虎子、味を見てくれないか」",
      "translatedEnglishLine": "\"Katsuko, Torako, could you taste this for me?\""
    },
    {
      "lineNumber": 123344,
      "originalJapaneseLine": "「うん！　おいしー！",
      "translatedEnglishLine": "\"Yeah! Delicious!\""
    },
    {
      "lineNumber": 123345,
      "originalJapaneseLine": "　さすが謙信様です！」",
      "translatedEnglishLine": "As expected of Kenshin-sama!\""
    },
    {
      "lineNumber": 123346,
      "originalJapaneseLine": "「あ、あのぉ……",
      "translatedEnglishLine": "\"U-um...\""
    },
    {
      "lineNumber": 123347,
      "originalJapaneseLine": "　ですが、この量はさすがに、その……」",
      "translatedEnglishLine": "However, this amount is really, um...\""
    },
    {
      "lineNumber": 123348,
      "originalJapaneseLine": "「むっ……」",
      "translatedEnglishLine": "\"Mmm...\""
    },
    {
      "lineNumber": 123349,
      "originalJapaneseLine": "「またやってしまったか……」",
      "translatedEnglishLine": "\"Did I do it again...?\""
    },
    {
      "lineNumber": 123350,
      "originalJapaneseLine": "「あっ、少し減らせば大丈夫な筈です！」",
      "translatedEnglishLine": "\"Ah, it should be fine if you eat a little less!\""
    },
    {
      "lineNumber": 123351,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"...\""
    },
    {
      "lineNumber": 123352,
      "originalJapaneseLine": "「そわそわしとるぞ」",
      "translatedEnglishLine": "\"You're fidgeting.\""
    },
    {
      "lineNumber": 123353,
      "originalJapaneseLine": "「……っ」",
      "translatedEnglishLine": "\"...\""
    },
    {
      "lineNumber": 123354,
      "originalJapaneseLine": "「はあ……」",
      "translatedEnglishLine": "\"*sigh*...\""
    },
    {
      "lineNumber": 123355,
      "originalJapaneseLine": "「あんな美少女に世話してもらえるなんて、",
      "translatedEnglishLine": "\"To be cared for by such a beautiful girl,"
    },
    {
      "lineNumber": 123356,
      "originalJapaneseLine": "　世の男なら泣いて喜ぶぞ」",
      "translatedEnglishLine": "any man in the world would cry tears of joy.\""
    },
    {
      "lineNumber": 123357,
      "originalJapaneseLine": "「私は女ですから」",
      "translatedEnglishLine": "\"Because I am a woman.\""
    },
    {
      "lineNumber": 123358,
      "originalJapaneseLine": "「そんなに嫌なのか？」",
      "translatedEnglishLine": "\"Do you dislike it that much?\""
    },
    {
      "lineNumber": 123359,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"...\""
    },
    {
      "lineNumber": 123360,
      "originalJapaneseLine": "「そうですね……」",
      "translatedEnglishLine": "\"Well...\""
    },
    {
      "lineNumber": 123361,
      "originalJapaneseLine": "「私の為にしてくれているんです」",
      "translatedEnglishLine": "\"She is doing it for me.\""
    },
    {
      "lineNumber": 123362,
      "originalJapaneseLine": "「嬉しくないわけはありませんね」",
      "translatedEnglishLine": "\"There's no way I wouldn't be happy about that.\""
    },
    {
      "lineNumber": 123363,
      "originalJapaneseLine": "「お、素直」",
      "translatedEnglishLine": "\"Oh, you're honest.\""
    },
    {
      "lineNumber": 123364,
      "originalJapaneseLine": "「こんなレアな愛ちゃんも戦争のおかげか。",
      "translatedEnglishLine": "\"Even such a rare Ai-chan, thanks to the war,"
    },
    {
      "lineNumber": 123365,
      "originalJapaneseLine": "　そう考えるとあながち悪いことばかりでもないな」",
      "translatedEnglishLine": "when you think about it, it's not all bad.\""
    },
    {
      "lineNumber": 123366,
      "originalJapaneseLine": "「不謹慎ですよ」",
      "translatedEnglishLine": "\"That's inappropriate.\""
    },
    {
      "lineNumber": 123367,
      "originalJapaneseLine": "「愛、昼餉-ﾋﾙｹﾞ-が出来た」",
      "translatedEnglishLine": "\"Ai, lunch is ready.\""
    },
    {
      "lineNumber": 123368,
      "originalJapaneseLine": "「お医者様も言っていた。",
      "translatedEnglishLine": "\"The doctor also said,"
    },
    {
      "lineNumber": 123369,
      "originalJapaneseLine": "　とにかく栄養をつけることだと」",
      "translatedEnglishLine": "that the most important thing is to get nutrition.\""
    },
    {
      "lineNumber": 123370,
      "originalJapaneseLine": "「食べるものを食べなければ、",
      "translatedEnglishLine": "\"If you don't eat food,"
    },
    {
      "lineNumber": 123371,
      "originalJapaneseLine": "　元気も出ない……筈。",
      "translatedEnglishLine": "you won't have any energy... that's for sure."
    },
    {
      "lineNumber": 123372,
      "originalJapaneseLine": "　食べてくれ、愛」",
      "translatedEnglishLine": "Please eat, Ai.\""
    },
    {
      "lineNumber": 123373,
      "originalJapaneseLine": "ほかほかと湯気を立てる料理が",
      "translatedEnglishLine": "Steaming hot food is"
    },
    {
      "lineNumber": 123374,
      "originalJapaneseLine": "愛の前に並べられる。",
      "translatedEnglishLine": "set out in front of Ai."
    },
    {
      "lineNumber": 123375,
      "originalJapaneseLine": "「え、ええ、美味しそうですね。",
      "translatedEnglishLine": "\"Um, y-yeah, it looks delicious."
    },
    {
      "lineNumber": 123376,
      "originalJapaneseLine": "　では早速……」",
      "translatedEnglishLine": "Well then, I'll dig in right away...\""
    },
    {
      "lineNumber": 123377,
      "originalJapaneseLine": "「あ、待った」",
      "translatedEnglishLine": "\"Ah, wait!\""
    },
    {
      "lineNumber": 123378,
      "originalJapaneseLine": "「あーん」",
      "translatedEnglishLine": "\"Ah—n (opening mouth to feed)\""
    },
    {
      "lineNumber": 123379,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"...\""
    },
    {
      "lineNumber": 123380,
      "originalJapaneseLine": "「あの、これは、どういう……」",
      "translatedEnglishLine": "\"Um, what is this...\""
    },
    {
      "lineNumber": 123381,
      "originalJapaneseLine": "「お医者様は言っていた。",
      "translatedEnglishLine": "\"The doctor said,"
    },
    {
      "lineNumber": 123382,
      "originalJapaneseLine": "　とにかく体を休めることだと」",
      "translatedEnglishLine": "that above all, you must rest your body.\""
    },
    {
      "lineNumber": 123383,
      "originalJapaneseLine": "「愛は病人なんだ。",
      "translatedEnglishLine": "\"Ai is a sick person."
    },
    {
      "lineNumber": 123384,
      "originalJapaneseLine": "　世話は私がする」",
      "translatedEnglishLine": "I will take care of her.\""
    },
    {
      "lineNumber": 123385,
      "originalJapaneseLine": "「それは……」",
      "translatedEnglishLine": "\"That is...\""
    },
    {
      "lineNumber": 123386,
      "originalJapaneseLine": "「その……」",
      "translatedEnglishLine": "\"Um...\""
    },
    {
      "lineNumber": 123387,
      "originalJapaneseLine": "「その通りですが……」",
      "translatedEnglishLine": "\"That's correct, but...\""
    },
    {
      "lineNumber": 123388,
      "originalJapaneseLine": "「すごい……",
      "translatedEnglishLine": "\"Amazing...\""
    },
    {
      "lineNumber": 123389,
      "originalJapaneseLine": "　こんなに困ってる愛ちゃん初めて見る」",
      "translatedEnglishLine": "This is the first time I've seen Ai-chan so troubled.\""
    },
    {
      "lineNumber": 123390,
      "originalJapaneseLine": "「私もぉ……」",
      "translatedEnglishLine": "\"Me too...\""
    }
  ]
}

